import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and fill with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after filling search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using multiple selector strategies
    const searchButton = await page.$('.search-btn:first-of-type') || 
                         await page.$('button.search-btn') ||
                         await page.$('button:has-text("Search")') ||
                         await page.$('button:visible:has(svg)');

    if (searchButton) {
      await searchButton.click();
    } else {
      // Fallback: press Enter in search input
      await page.press('#searchInput', 'Enter');
    }

    // Wait for search results to load
    await page.waitForSelector('.product-card, .products-grid, .search-results', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = {};

    // Get results count
    const resultsCount = await page.$eval('.results-count', el => el.textContent).catch(() => null);
    if (resultsCount) extractedData.resultsCount = resultsCount;

    // Get product titles
    const productTitles = await page.$$eval('.product-title', titles => 
      titles.slice(0, 5).map(t => t.textContent.trim())
    ).catch(() => []);

    if (productTitles.length > 0) {
      extractedData.productTitles = productTitles;
    }

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
